import React from "react";
import Head from "next/head";
import Layout from "../components/layout";

export default function JustSell({ Component }) {
  return (
    <>
      <Head>
        <title>JustSell</title>
      </Head>
      <style jsx global>{`
        body {
          background: #000;
          font: 11px menlo;
          color: #fff;
        }
      `}</style>
      <Layout>
        <Component />
      </Layout>
    </>
  );
}
